import org.apache.commons.jexl3.JexlScript;
import org.apache.commons.jexl3.JexlBuilder;
import org.apache.commons.jexl3.JexlFeatures;
import org.apache.commons.jexl3.MapContext;
import org.junit.jupiter.api.Assertions;
import org.junit.jupiter.api.Test;
import java.util.Collection;
import java.util.concurrent.atomic.AtomicInteger;
import java.util.concurrent.atomic.AtomicBoolean;
import java.util.concurrent.Callable;

public class JexlBlockTest {

    public static class AnnotatedContext extends MapContext implements JexlContext.AnnotationProcessor {
        private final AtomicInteger invocationCount = new AtomicInteger(0);
        private final AtomicBoolean synchronizationMarker = new AtomicBoolean(false);

        @Override
        public Object processAnnotation(String name, Object[] args, Callable<Object> callable) throws Exception {
            if ("synchronized".equals(name)) {
                invocationCount.incrementAndGet();
                synchronizationMarker.set(true);
            }
            return callable.call();
        }

        public int getInvocationCount() {
            return invocationCount.get();
        }

        public boolean hasSynchronizationMarker() {
            return synchronizationMarker.get();
        }
    }

    @Test
    public void testBlockStructures() throws Exception {
        JexlFeatures features = new JexlFeatures().annotation(true);
        JexlBuilder jexlBuilder = new JexlBuilder().features(features);
        JexlEngine jexlEngine = jexlBuilder.create();
        AnnotatedContext annotationProcessorContext = new AnnotatedContext();

        // Steps 3-6
        JexlScript script1 = jexlEngine.createScript("@synchronized { 42; }");
        Object scriptResult1 = script1.execute(annotationProcessorContext);
        Assertions.assertEquals(42, scriptResult1);
        Assertions.assertEquals(1, annotationProcessorContext.getInvocationCount());
        Assertions.assertTrue(annotationProcessorContext.hasSynchronizationMarker());

        // Steps 7-10
        JexlScript script2 = jexlEngine.createScript("@synchronized { 42 }");
        Object scriptResult2 = script2.execute(annotationProcessorContext);
        Assertions.assertTrue(scriptResult2 instanceof Collection);
        Assertions.assertEquals(1, ((Collection<?>) scriptResult2).size());
        Assertions.assertEquals(2, annotationProcessorContext.getInvocationCount());
        Assertions.assertTrue(annotationProcessorContext.hasSynchronizationMarker());

        // Steps 11-12
        JexlScript script3 = jexlEngine.createScript("{ 42 }");
        Object scriptResult3 = script3.execute(annotationProcessorContext);
        Assertions.assertTrue(scriptResult3 instanceof Collection);

        // Steps 13-14
        JexlScript script4 = jexlEngine.createScript("{ 42; }");
        Object scriptResult4 = script4.execute(annotationProcessorContext);
        Assertions.assertEquals(42, scriptResult4);

        // Steps 15-16
        JexlScript script5 = jexlEngine.createScript("{ 'foo' : 'bar' }['foo']");
        Object scriptResult5 = script5.execute(annotationProcessorContext);
        Assertions.assertEquals("bar", scriptResult5);

        // Steps 17-18
        JexlScript script6 = jexlEngine.createScript("{ var x = 42; }");
        Object scriptResult6 = script6.execute(annotationProcessorContext);
        Assertions.assertEquals(42, scriptResult6);

        // Steps 19-20
        JexlScript script7 = jexlEngine.createScript("@synchronized('foo') { 42; }");
        Object scriptResult7 = script7.execute(annotationProcessorContext);
        Assertions.assertEquals(42, scriptResult7);

        // Steps 21-22
        JexlScript script8 = jexlEngine.createScript("{ var x = 42 }");
        Object scriptResult8 = script8.execute(annotationProcessorContext);
        Assertions.assertTrue(scriptResult8 instanceof Collection);

        // Steps 23-24
        JexlScript script9 = jexlEngine.createScript("@synchronized('foo') { var x = 42 }");
        Object scriptResult9 = script9.execute(annotationProcessorContext);
        Assertions.assertTrue(scriptResult9 instanceof Collection);

        // Steps 25-26
        JexlScript script10 = jexlEngine.createScript("{ var x = 21; var y = 21; x + y }");
        Object scriptResult10 = script10.execute(annotationProcessorContext);
        Assertions.assertEquals(42, scriptResult10);

        // Steps 27-28
        JexlScript script11 = jexlEngine.createScript("40 + 2;");
        Object scriptResult11 = script11.execute(annotationProcessorContext);
        Assertions.assertEquals(42, scriptResult11);

        // Steps 29-30
        JexlScript script12 = jexlEngine.createScript("40 + 2");
        Object scriptResult12 = script12.execute(annotationProcessorContext);
        Assertions.assertEquals(42, scriptResult12);

        // Steps 31-32
        JexlScript script13 = jexlEngine.createScript("@synchronized('foo') { 40 + 2; }");
        Object scriptResult13 = script13.execute(annotationProcessorContext);
        Assertions.assertEquals(42, scriptResult13);

        // Steps 33-34
        JexlScript script14 = jexlEngine.createScript("@synchronized('foo') { 40 + 2 }");
        Object scriptResult14 = script14.execute(annotationProcessorContext);
        Assertions.assertTrue(scriptResult14 instanceof Collection);
    }
