package org.apache.commons.jexl3;

import org.apache.commons.jexl3.JexlBuilder;
import org.apache.commons.jexl3.JexlContext;
import org.apache.commons.jexl3.JexlEngine;
import org.apache.commons.jexl3.JexlFeatures;
import org.apache.commons.jexl3.JexlScript;
import org.apache.commons.jexl3.MapContext;
import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.Assertions;
import java.util.Collection;
import java.util.Arrays;

public class ScriptingAmbiguousStatementsTest {

    @Test
    public void testAmbiguousStatements() {
        // Step 0: Create a new JexlFeatures object
        JexlFeatures system_configuration = new JexlFeatures();

        // Step 1: Configure the scripting system to permit ambiguous statements
        system_configuration.ambiguousStatement(true);

        // Step 2: Verify the ambiguous statement capability is active in the configuration
        Assertions.assertTrue(system_configuration.supportsAmbiguousStatement());

        // Step 3: Create a new JexlBuilder object
        JexlBuilder builder = new JexlBuilder();

        // Step 4: Set the features on the JexlBuilder
        builder.features(system_configuration);

        // Step 5: Construct a scripting engine instance with the specified configuration
        JexlEngine scripting_engine = builder.create();

        // Step 6 & 7: Prepare and parse a script with ambiguous statement syntax
        String ambiguous_script = "list = new('java.util.LinkedList')\nadd = function(x) { list.addLast(x) }\nadd(42)\nadd(1337)\nlist";
        JexlScript parsed_script = scripting_engine.createScript(ambiguous_script);

        // Step 8: Assert the script parsing completes successfully
        Assertions.assertNotNull(parsed_script);

        // Step 9: Create a new MapContext
        JexlContext context = new MapContext();

        // Step 10: Execute the parsed script
        Object execution_result = parsed_script.execute(context);

        // Step 11: Assert the execution result is a collection
        Assertions.assertTrue(execution_result instanceof Collection);

        // Step 12: Assert the collection contains exactly two entries
        Assertions.assertEquals(2, ((Collection<?>) execution_result).size());

        // Step 13: Assert the collection entries match the numeric values
        Assertions.assertTrue(((Collection<?>) execution_result).containsAll(Arrays.asList(42, 1337)));
    }
}

