package org.apache.commons.jexl3;

import org.apache.commons.jexl3.JexlBuilder;
import org.apache.commons.jexl3.JexlContext;
import org.apache.commons.jexl3.JexlEngine;
import org.apache.commons.jexl3.JexlExpression;
import org.apache.commons.jexl3.JexlFeatures;
import org.apache.commons.jexl3.MapContext;
import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.assertFalse;
import static org.junit.jupiter.api.Assertions.assertTrue;

public class JexlTest1 {

    @Test
    public void testSqlComparators() {
        JexlFeatures restrictedLanguageFeatures = new JexlFeatures();
        restrictedLanguageFeatures.loops(false);
        restrictedLanguageFeatures.lambda(false);
        restrictedLanguageFeatures.sideEffect(false);
        restrictedLanguageFeatures.sideEffectGlobal(false);
        restrictedLanguageFeatures.localVar(false);

        JexlBuilder jexlBuilder = new JexlBuilder();
        jexlBuilder.features(restrictedLanguageFeatures);
        jexlBuilder.lexical(true);
        jexlBuilder.cache(32);

        JexlEngine evaluationEngine = jexlBuilder.create();
        JexlContext jexlContext = new MapContext();

        JexlExpression inequalityExpression = evaluationEngine.createExpression("x <> 25");
        jexlContext.set("x", 24);
        Object result = inequalityExpression.evaluate(jexlContext);
        assertTrue((Boolean) result);

        jexlContext.set("x", 25);
        result = inequalityExpression.evaluate(jexlContext);
        assertFalse((Boolean) result);

        JexlExpression equalityExpression = evaluationEngine.createExpression("x == 25");
        jexlContext.set("x", 24);
        result = equalityExpression.evaluate(jexlContext);
        assertFalse((Boolean) result);

        JexlExpression notEqualExpression = evaluationEngine.createExpression("x != 25");
        jexlContext.set("x", 24);
        result = notEqualExpression.evaluate(jexlContext);
        assertTrue((Boolean) result);

        jexlContext.set("x", 25);
        result = equalityExpression.evaluate(jexlContext);
        assertTrue((Boolean) result);

        jexlContext.set("x", 25);
        result = notEqualExpression.evaluate(jexlContext);
        assertFalse((Boolean) result);
    }
}

package org.apache.commons.jexl3.tests;

import org.apache.commons.jexl3.JexlBuilder;
import org.apache.commons.jexl3.JexlEngine;
import org.apache.commons.jexl3.JexlFeatures;
import org.apache.commons.jexl3.JexlScript;
import org.junit.jupiter.api.Assertions;
import org.junit.jupiter.api.Test;

public class SqlStyleOperatorsTest {

    @Test
    public void testSqlStyleOperators() throws Exception {
        // Step 0: Construct a restricted JexlFeatures instance
        JexlFeatures restricted_features = new JexlFeatures()
                .localVar(false)
                .loops(false)
                .sideEffect(false)
                .sideEffectGlobal(false)
                .lambda(false);

        // Step 1: Create a JexlBuilder configured with the restricted features and cache size
        JexlBuilder configured_builder = new JexlBuilder()
                .features(restricted_features)
                .cache(32);

        // Step 2: Create a JexlEngine from the configured builder
        JexlEngine jexl_engine = configured_builder.create();

        // Steps 3-5: Test "x <> 10" with a non-matching value
        JexlScript script1 = jexl_engine.createScript("x <> 10", new String[]{"x"});
        Object result1 = script1.execute(null, 5);
        Assertions.assertTrue((Boolean) result1);

        // Steps 6-8: Test "x <> 10" with a matching value
        JexlScript script2 = jexl_engine.createScript("x <> 10", new String[]{"x"});
        Object result2 = script2.execute(null, 10);
        Assertions.assertFalse((Boolean) result2);

        // Steps 9-11: Test "x = 10" with a non-matching value
        JexlScript script3 = jexl_engine.createScript("x = 10", new String[]{"x"});
        Object result3 = script3.execute(null, 5);
        Assertions.assertFalse((Boolean) result3);

        // Steps 12-14: Test "x = 10" with a matching value
        JexlScript script4 = jexl_engine.createScript("x = 10", new String[]{"x"});
        Object result4 = script4.execute(null, 10);
        Assertions.assertTrue((Boolean) result4);

        // Steps 15-17: Test "x != 10" with a non-matching value
        JexlScript script5 = jexl_engine.createScript("x != 10", new String[]{"x"});
        Object result5 = script5.execute(null, 5);
        Assertions.assertTrue((Boolean) result5);

        // Steps 18-20: Test "x != 10" with a matching value
        JexlScript script6 = jexl_engine.createScript("x != 10", new String[]{"x"});
        Object result6 = script6.execute(null, 10);
        Assertions.assertFalse((Boolean) result6);
    }
}

