package org.apache.commons.jexl3;

import org.junit.jupiter.api.AfterEach;
import org.junit.jupiter.api.Test;

import java.lang.ref.WeakReference;

import static org.junit.jupiter.api.Assertions.assertNotNull;
import static org.junit.jupiter.api.Assertions.assertNull;

public class CacheManagementTest {

    private JexlEngine firstCacheArea;
    private JexlEngine secondCacheArea;

    @AfterEach
    public void tearDown() {
        if (firstCacheArea != null) {
            firstCacheArea.clearCache();
        }
        if (secondCacheArea != null) {
            secondCacheArea.clearCache();
        }
    }

    @Test
    public void testCacheEvictionAndGarbageCollection() throws InterruptedException {
        // Step 0 & 1: Create a first caching area with a capacity of three.
        JexlBuilder builder1 = new JexlBuilder();
        firstCacheArea = builder1.cache(3).create();

        // Step 2: Populate the first caching area with three key-value pairs.
        firstCacheArea.createScript("key1");
        firstCacheArea.createScript("key2");
        firstCacheArea.createScript("key3");

        // Step 4: Verify all three stored values can be retrieved correctly.
        assertNotNull(firstCacheArea.createScript("key1"));
        assertNotNull(firstCacheArea.createScript("key2"));
        assertNotNull(firstCacheArea.createScript("key3"));

        // Step 5: Add a fourth entry to the first caching area.
        firstCacheArea.createScript("key4");

        // Step 8: Verify the three most recent entries remain retrievable.
        assertNotNull(firstCacheArea.createScript("key2"));
        assertNotNull(firstCacheArea.createScript("key3"));
        assertNotNull(firstCacheArea.createScript("key4"));

        // Step 9: Create a second independent caching area with a capacity of two.
        JexlBuilder builder2 = new JexlBuilder();
        secondCacheArea = builder2.cache(2).create();

        // Step 10: Populate the second caching area with two key-value pairs.
        secondCacheArea.createScript("keyA");
        secondCacheArea.createScript("keyB");

        // Step 12: Verify both values can be retrieved correctly.
        assertNotNull(secondCacheArea.createScript("keyA"));
        assertNotNull(secondCacheArea.createScript("keyB"));

        // Step 13: Add a third entry to the second caching area.
        secondCacheArea.createScript("keyC");

        // Step 16: Verify the two most recent entries are still accessible.
        assertNotNull(secondCacheArea.createScript("keyB"));
        assertNotNull(secondCacheArea.createScript("keyC"));

        // Setup for GC test
        WeakReference<JexlEngine> weakFirstCache = new WeakReference<>(firstCacheArea);
        WeakReference<JexlEngine> weakSecondCache = new WeakReference<>(secondCacheArea);

        // Step 18: Release application references to the caching areas.
        firstCacheArea = null;
        secondCacheArea = null;

        // Step 19: Trigger the system's memory reclamation process.
        System.gc();

        // Step 20: Allow time for automatic cleanup to occur.
        Thread.sleep(1000);

        // Step 21: Verify the cache management system no longer tracks any caching areas.
        assertNull(weakFirstCache.get(), "First cache area should have been garbage collected.");
        assertNull(weakSecondCache.get(), "Second cache area should have been garbage collected.");
    }
}

package org.apache.commons.jexl3.internal;

import org.apache.commons.jexl3.JexlCache;
import org.junit.jupiter.api.Test;

import java.util.function.IntFunction;

import static org.junit.jupiter.api.Assertions.assertEquals;
import static org.junit.jupiter.api.Assertions.assertNull;

public class MetaCacheTest {

    @Test
    public void testMetaCache() throws InterruptedException {
        MetaCache mc = new MetaCache(SoftCache::new);
        JexlCache<Integer, String> cache1 = mc.createCache(3);
        cache1.put(1, "one");
        cache1.put(2, "two");
        cache1.put(3, "three");
        assertEquals(3, cache1.size());
        assertEquals("one", cache1.get(1));
        assertEquals("two", cache1.get(2));
        assertEquals("three", cache1.get(3));
        cache1.put(4, "four");
        assertEquals(3, cache1.size());
        assertNull(cache1.get(1));
        assertEquals("two", cache1.get(2));
        assertEquals("three", cache1.get(3));
        assertEquals("four", cache1.get(4));

        JexlCache<String, String> cache2 = mc.createCache(2);
        cache2.put("a", "A");
        cache2.put("b", "B");
        assertEquals(2, cache2.size());
        assertEquals("A", cache2.get("a"));
        assertEquals("B", cache2.get("b"));
        cache2.put("c", "C");
        assertEquals(2, cache2.size());
        assertNull(cache2.get("a"));
        assertEquals("B", cache2.get("b"));
        assertEquals("C", cache2.get("c"));

        assertEquals(2, mc.size());

        cache1 = null;
        assertNull(cache1);
        cache2 = null;
        assertNull(cache2);

        System.gc();
        for (int i = 0; i < 5 && mc.size() != 0; i++) {
            try {
                Thread.sleep(100);
            } catch (InterruptedException xint) {
                // ignore
            }
        }
        assertEquals(0, mc.size(), "metacache should have no more cache references");
    }
}

package org.apache.commons.jexl3.internal;

import org.apache.commons.jexl3.JexlFeatures;
import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.*;

public class SourceTest {

    @Test
    public void testSourceEqualityAndComparison() {
        // Step 0: Obtain a default JexlFeatures configuration
        JexlFeatures jexlFeatures = JexlFeatures.createDefault();

        // Step 1: Construct a Source instance with specific script text
        Source source1 = new Source(jexlFeatures, null, "var x = 1;");

        // Step 2: Construct a second Source instance with identical script text
        Source source2 = new Source(jexlFeatures, null, "var x = 1;");

        // Step 3: Construct a third Source instance with different script text
        Source source3 = new Source(jexlFeatures, null, "var x = 2;");

        // Step 4: Get the text length of the first source instance
        int textLength = source1.length();

        // Step 8: Verify the text length is correct
        assertEquals(10, textLength);

        // Step 5 & 9: Perform equality checks and verify results
        boolean equalityResultIdentical = source1.equals(source2);
        assertTrue(equalityResultIdentical);

        boolean equalityResultDifferent = source1.equals(source3);
        assertFalse(equalityResultDifferent);

        // Step 6 & 10: Get hash codes and verify results
        int hashCode1 = source1.hashCode();
        int hashCode2 = source2.hashCode();
        int hashCode3 = source3.hashCode();
        assertEquals(hashCode1, hashCode2);
        assertNotEquals(hashCode1, hashCode3);

        // Step 7 & 11: Perform comparisons and verify results
        int comparisonResultIdentical = source1.compareTo(source2);
        assertEquals(0, comparisonResultIdentical);

        int comparisonResultNegative = source1.compareTo(source3);
        assertTrue(comparisonResultNegative < 0, "Comparison of source1 to source3 should be negative");

        int comparisonResultPositive = source3.compareTo(source1);
        assertTrue(comparisonResultPositive > 0, "Comparison of source3 to source1 should be positive");
    }
}

