public class SourceTest {

    @Test
    public void testSource() {
        // Step 0: Create a JexlBuilder
        JexlBuilder jexlBuilder = new JexlBuilder();

        // Step 1: Configure the expression evaluation system with a cache capacity of 4
        jexlBuilder.cache(4);

        // Step 2: Create the JexlEngine
        JexlEngine jexlEngine = jexlBuilder.create();

        // Step 3: Establish a baseline source configuration
        JexlScript baselineSourceConfig = jexlEngine.createScript("a + b", new String[]{"a", "b"});

        // Step 4: Compare the baseline source configuration with an incompatible plain text string
        boolean stringComparisonResult = baselineSourceConfig.equals("some string");

        // Step 5: Compare the baseline source configuration with a configuration that has missing references
        boolean missingRefComparisonResult = baselineSourceConfig.equals(new Object());

        // Step 6: Verify the comparison with the string indicates they are not equal
        Assertions.assertFalse(stringComparisonResult);

        // Step 7: Verify the comparison with the missing reference configuration indicates they are not equal
        Assertions.assertFalse(missingRefComparisonResult);

        // Step 8: Prepare an alternative source configuration
        JexlScript altPositionSourceConfig = jexlEngine.createScript("a + b", new String[]{"b", "a"});

        // Step 9: Perform an equality check
        boolean positionEqualityResult = baselineSourceConfig.equals(altPositionSourceConfig);

        // Step 11: Verify the equality check confirms the configurations are distinct
        Assertions.assertFalse(positionEqualityResult);

        // Step 13: Create a source configuration that omits variable mappings
        JexlScript noMappingSourceConfig = jexlEngine.createScript("a + b");

        // Step 14: Compare the baseline source configuration with the no-mapping configuration
        boolean noMappingComparisonResult = baselineSourceConfig.equals(noMappingSourceConfig);

        // Step 15: Verify the configurations are considered different
        Assertions.assertFalse(noMappingComparisonResult);

        // Step 19: Clear the expression cache
        ((Engine) jexlEngine).clearCache();

        // Step 20: Create a calculation expression with variables declared in a specific sequence
        JexlScript expressionInstance1 = jexlEngine.createScript("x * y", new String[]{"x", "y"});

        // Step 21: Create the same calculation expression with variables declared in reverse sequence
        JexlScript expressionInstance2 = jexlEngine.createScript("x * y", new String[]{"y", "x"});

        // Step 22: Verify the system stores both expressions as separate cache entries
        Assertions.assertNotEquals(expressionInstance1, expressionInstance2);

        // Step 23: Verify the cache contains two entries
        Assertions.assertEquals(2, ((Engine) jexlEngine).getCache().size());

        // Step 24: Clear the cache to reset the state
        ((Engine) jexlEngine).clearCache();

        // Step 25: Create a calculation expression with a specific variable sequence
        JexlScript firstIdenticalExpression = jexlEngine.createScript("z / w", new String[]{"z", "w"});

        // Step 26: Create the same calculation expression with the identical variable sequence
        JexlScript secondIdenticalExpression = jexlEngine.createScript("z / w", new String[]{"z", "w"});

        // Step 27: Verify the system recognizes the two expressions as equivalent
        Assertions.assertSame(firstIdenticalExpression, secondIdenticalExpression);

        // Step 28: Verify the system stores only one cache entry
        Assertions.assertEquals(1, ((Engine) jexlEngine).getCache().size());

        // Step 29: Clear the expression cache
        ((Engine) jexlEngine).clearCache();
    }
}
